import Design from "./Design"

const DesTable = ({designes, onClick, onClose}) => {
    return (
        <div className='designTable'>
            {designes.map((design) => (
                <Design design={design} onClick={onClick} onClose={onClose}/>
            ))}
        </div>
    )
}

export default DesTable
